import React, { Component } from "react";
import Weather from "./Weather";

class Find extends Component {
  componentDidMount() {
    this.getWeather();
  }
  render() {
    const { city } = this.props.match.params.id;
    return (
      <React.Fragment>
        <h1>Find</h1>
        <Weather targetCity={city} />
      </React.Fragment>
    );
  }
}

export default Find;
